(4,'akhila','6G2BDe71GuUPdFoe4xbaPKsZ','Bangalore','Engineering','Designing','Java','akhila.txt','ProGuard: Detecting Malicious Accounts in Social-Network-Based Online Promotions ABSTRACT: Online social networks gradually integrate financial capabilities by enabling the usage of real  virtual currency. They serve as new platforms to host a variety of business activities such as online promotion events, where users can possibly get virtual currency as rewards by participating such events. Both OSNs  business partners are significantly concerned when attackers instrument a set of accounts to collect virtual currency from  events, which make  events ineffective  result in significant financial loss. It becomes of great importance to proactively detecting  malicious accounts before the online promotion activities  subsequently decreases their priority to be rewarded. In th paper, we propose a novel system, namely ProGuard, to accomplh th objective by systematically integrating features that characterize accounts from three perspectives including their general behaviors, their recharging patterns,  the usage of their currency. We have performed extensive experiment s based on data collected from Tencent QQ, a global leading OSN with built-in financial management activities. Experimental results have demonstrated that our system can accomplh a high detection rate of 96.67% at a very low false positive rate of 0.3%.     EXISTING SYSTEM: Online social networks gradually integrate financial capabilities by enabling the usage of real  virtual currency. They serve as new platforms to host a variety of business activities such as online promotion events, where users can possibly get Virtual currency as rewards by participating such events` DISADVANTAGES  •	There  no detection mechanm for finding the malicious accounts. •	Events become ineffective. •	Great financial loss.   PROPOSED SYSTEM: In th project, we propose a novel system, namely ProGuard, to accomplh th objective by systematically integrating features that characterize accounts from three perspectives including their general behaviours, their recharging patterns,  the usage of their currency. We have performed extensive experiments based on data collected from Tencent QQ, a global leading OSN with built-in financial management activities. Experimental results have demonstrated that our system can accomplh a high detection rate of 96.67% at a very low false positive rate of 0.3%  ADVANTAGES •	Detecting the malicious accounts by using ProGuard mechanm. •	 By sending virtual currency to the correct user events become effective. •	Profits will increase. SYSTEM ARCHITECTURE:   SYSTEM REQUIREMENTS: HARDWARE REQUIREMENTS:  ?	System			: 	Pentium Dual Core. ?	Hard Dk 			: 	120 GB. ?	Monitor			: 	15’’ LED ?	Input Devices		: 	Keyboard, Mouse ?	Ram				: 	1GB. SOFTWARE REQUIREMENTS: ?	Operating system 		: 	Windows 7. ?	Coding Language		:	JAVA/J2EE ?	Tool				:	Netbeans 7.2.1 ?	Database			:	MYSQL REFERENCE: Yadong Zhou, Dae Wook Kim, Junjie Zhang, Member, IEEE, Lili Liu, Huan Jin, Hongbo Jin, Ting Liu., \" ProGuard: Detecting Malicious Accounts in Social-Network-Based Online Promotions,\" in IEEE Special Section: Trust  anagement in Pervasive Social Networking,. DOI 10.1109/ACCESS.2017.2654272   	   ',0.383686,'9jE0DnU2HOF8Ur03kk/Jpd3ulMZYxuBrF8qNn1wxSA2yIbMJH6qK52ORSsQCkan7ZjcFlcl3del5\r\nUWIXnP5AgpQH7UThdH/vr8yejOpxI1L6X6V13cfV7pbOMgE6JK8c2jkI07/7vrbs3yb8wN6cZQ7B\r\nEreu/a0HI4asJmHYZqTZ7J1MR05blP8M5+fKb1jbAPGAbEEhvUpJmagFWG++gmFAcmecm8nHwBE1\r\nvIL6lqBkq1LaMVuhuRkITADmGB6Z6gCARWRHtRzGgpcWas9rRZt95Nx0xIYfIgdezBqeMSXBbsZD\r\ngTiMf6375I7B7lBDBxnzP+u4y99NKBRXgGBsB7b50xP4yZeTsBwqEYav4ULqEEFVtgBbASW5v794\r\nDTU0SPJeCN7Nw9Yffy5IztaUokT6ZZuw+3sJxhXhegpftQxx8wPbLnJboMkgM5UGCYpB+W0uhTvc\r\nVdWHvChj4rk/c71YSgxvz26s4zNHuo+rSvOy4asS7TSRQQsjMbdnDDWF72cOUD7+/1HTbnr6dXDS\r\nEmU3ArdCdF45GCPcy0JkSqjmHGXSHJhCw3Ua+Xu6gnzikM9bHzODCRoq+RePTBvtfI0UuPwkjHvb\r\nQ0WUF6E5SVi0Y8YtFcgczzT8T9QwX4JyLidF3XV6N35sMPI0wmKKUGXm