(5,'akhila','6G2BDe71GuUPdFoe4xbaPKsZ','Bangalore','Engineering','Designing','Java','sangeetha.txt','Customer-Satfaction-Aware Optimal Multi-server Configuration for Profit Maximization in Cloud Computing  ABSTRACT: Along with the development of cloud computing, an increasing number of enterpres start to adopt cloud service, which promotes the emergence of many cloud service providers. For cloud service providers, how to configure their cloud service platforms to obtain the maximum profit becomes increasingly the focus that they pay attention to. In th paper, we take customer satfaction into consideration to address th problem. Customer satfaction affects the profit of cloud service providers in two ways. On one h, the cloud configuration affects the quality of service which  an important factor affecting customer satfaction. On the other h, the customer satfaction affects the request arrival rate of a cloud service provider. However, few exting works take customer satfaction into consideration in solving profit maximization problem, or the exting works considering customer satfaction do not give a proper formalized definition for it. Hence, we firstly refer to the definition of customer satfaction in economics  develop a formula for measuring customer satfaction in cloud computing. And then, an analys  given in detail on how the customer satfaction affects the profit. Lastly, taking into consideration customer satfaction, service-level agreement, renting price, energy consumption  so forth, a profit maximization problem  formulated  solved to get the optimal configuration such that the profit  maximized.  EXISISTING SYSTEM Customer satfaction affects the profit of cloud service providers in two ways. On one h, the cloud configuration affects the quality of service which  an important factor affecting customer satfaction. On the other h, the customer satfaction affects the request arrival rate of a cloud service provider. However, the exting works considering customer satfaction do not give a proper formalized definition for it.  DISADVANTAGES OF EXISISTING SYSTEM:- •	Customer satfaction does not give proper direction for it.  •	Quality of service very poor. •	Price of Service  high. •	The results of profit were very poor.  PROPOSED SYSTEM In th system, we take customer satfaction into consideration to address th problem. We firstly refer to the definition of customer satfaction in economics  develop a formula for measuring customer satfaction in cloud computing. And then, an analys  given in detail on how the customer satfaction affects the profit. Lastly, taking into consideration customer satfaction, service-level agreement, renting price, energy consumption  so forth, a profit maximization problem  formulated  solved to get the optimal configuration such that the profit  maximized.  ADVANTAGES OF PROPOSED SYSTEM:- •	Customer satfaction   addressed proper direction •	Quality of service  increased. •	Profit  maximized.       SYSTEM REQUIREMENTS: HARDWARE REQUIREMENTS:  ?	System			: 	Pentium Dual Core. ?	Hard Dk 			: 	120 GB. ?	Monitor			: 	15’’ LED ?	Input Devices		: 	Keyboard, Mouse ?	Ram				: 	1GB.  SOFTWARE REQUIREMENTS:  ?	Operating system 		: 	Windows 7. ?	Coding Language		:	JAVA/J2EE ?	Tool				:	Net beans 7.2.1 ?	Database			:	MYSQL 	  ',0.228205,'yXvIX7bHE8y/BXarotnw3CFyV3dl2Y76iRSVQh6e6J1nqangmNy8Nk226vEmeUsf8hxMk7CI1BEy\r\nZF8YDpBNSsFInBHABwojogKPvl+JEsSKkRhV5H9CDMmUDbBNlaKR6/i057djZ3y2RrxS1r5OFQU3\r\nIrJdywaf0u+qfqU6oq9X5GXoG7XQvQIeigDocgQkeA6G8GHH/VeMgS9EwPkun2imqZ6SY4US4GBN\r\nTLQ071nqzZH/teSUGP1AcQY30WNmvQ5aCEDV1oL2qAlgHYnZRQ2NfM31jJ5B+NwE/fE92tQvWjh1\r\npENFT1oNE/wx3G1ObRXUmDl8wOxLQ/OO8+W12heKWRw/j1GekUXmaczHxu4Vg3RdUi5pYp/2V1Z7\r\nXpWUTqpwh4dO/n1f0rYMWpQrOIwNakdHOwp3A0oCoJx+N5jrme5iX7JwgNPC9v4czF0F1ZlOrCiU\r\nNuyQ1HvdPyI4u9QYNArgu4cfnoLDTA1ICqscOsSwQR5O0juZSnOSNMXM+hbxd5FRBWmzSc2QLVLS\r\ndbGjPlyu76hhlZJxz+0vhwoZRSX3xlGyiTQOmnC8bb7BgapzQd5PZplOwr8gih4VBmerZkZYrZ0K\r\nXssfMkDKf0+EdM8IkdIicyCaSTX1xo2OF5tSyfEGPRt3A