(9,'koushal','FO2H1dtVUwj6MT2ILDT9tWRW','Chennai','Engineering','Programming','Java','varam file3.txt','21.Data science – dcovery of data insight Th aspect of data science  all about uncovering findings from data. Diving in at a granular level to mine  underst complex behaviors, trends,  inferences. It\'s about surfacing hidden insight that can help enable companies to make smarter business decions. For example:  Netflix data mines Datapoint movie viewing patterns to underst what drives user interest,  uses that to make decions on which Netflix original series to produce. Target identifies what are major customer segments within it\'s base  the unique shopping behaviors within those segments, which helps to guide messaging to different market audiences. Proctor & Gamble utilizes time series models to more clearly underst future dem, which help plan for production levels more optimally. How do data scientts mine out insights? It starts with data exploration. When given a challenging question, data scientts become detectives. They investigate leads  try to underst pattern or charactertics within the data. Th requires a big dose of analytical creativity.  Then as needed, data scientts may apply quantitative technique in order to get a level deeper – e.g. inferential models, segmentation analys, time series forecasting, synthetic control experiments, etc. The intent  to scientifically piece together a forensic view of what the data  really saying.  Th data-driven insight  central to providing strategic guidance. In th sense, data scientts act as consultants, guiding business stakeholders on how to act on findings.  Data science – development of data product A \"data product\"  a technical asset that: (1) utilizes data as input,  (2) processes that data to return algorithmically-generated results. The classic example of a data product  a recommendation engine, which ingests user data,  makes personalized recommendations based on that data. Here are some examples of data products:  Amazon\'s recommendation engines suggest items for you to buy, determined by their algorithms. Netflix recommends movies to you. Spotify recommends music to you. Gmail\'s spam filter  data product – an algorithm behind the scenes processes incoming mail  determines if a message  junk or not. Computer vion used for self-driving cars  also data product – machine learning algorithms are able to recognize traffic lights, other cars on the road, pedestrians, etc. Th  different from the \"data insights\" section above, where the outcome to that  to perhaps provide advice to an executive to make a smarter business decion. In contrast, a data product  technical functionality that encapsulates an algorithm,   designed to integrate directly into core applications. Respective examples of applications that incorporate data product behind the scenes: Amazon\'s homepage, Gmail\'s inbox,  autonomous driving software.  Data scientts play a central role in developing data product. Th involves building out algorithms, as well as testing, refinement,  technical deployment into production systems. In th sense, data scientts serve as technical developers, building assets that can be leveraged at wide scale. ',0.835206,'GcoU2KUyCFLVwsgBWUPkmZxcxVJXtN8Oc1cSbAX4q7kVvbUmOzwFSp3eEkq+AWXsP/9x3IK7Xh2b\r\n35lQ0/+1Nh82O7ay18crm9TjYmJanQk0wNtxCoSAFav0VIbSEDzi1tDvFfD/4zY3zc7Y4Sl+/AYh\r\nSP+QE7+7BvQD81u2lWS02Oo6p9WbPFJx5uBRp/K9unpmWDiznK3fXJyk5Mfr6d8QcQXVl/NRPzZK\r\nMA5AQ5wy5DjPhnLL2CYikupv6S8eT0XyVCf8YvkMCO/w+uIyDhmNyVzDIq7rLDIXKTewEjJ60dkq\r\nU0oEhq6ccXN7QVpMeNPddjHGbTnTLpbJjUAaGsNmKpBWBf3w3nU6V3Hs55ltiwHiH7FwRSXoqPpj\r\nF5c8qMOTf60Q88e8Z2C+auLVo0zzk7NpQfqH6G3oCsX8ZhsK2rvDlU0EWQaNf9wwRyWkBG8tRLZ1\r\nE8hWJ2Xj6NqSBS50wOvoo1A3O8nLulJi1EQSHg+R9kljpQwRz+XzqbwY7UtO6m+kuxAtXOmLVwhc\r\niiGlyilsxVzm2eII36n8qx2t86GilYI1aCn4U5BQxef8ylZT1CZdQhrCTPj/04yeDVukHQ/IiIf4\r\njfyQb1nFhO9cYtYHUcqFnaotZ9341dSptv+e2JDZDzlF/K4rFd5tpgrXgWXe15OCyR7yr5uaiJdt\r\nmsDbnrcwjOSUkwzK/KkeZL5GUsOVXyYY4T30X7vF52ql+uQIOjL